// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract CircularBuffer {
    // Массив для хранения значений
    uint256[] private buffer;
    // Максимальный размер буфера
    uint256 private size;
    // Текущий индекс для добавления нового значения
    uint256 private index;

    // Конструктор, который инициализирует размер буфера и массив
    constructor(uint256 _size) {
        require(_size > 0, "Size must be > 0");
        buffer = new uint256[](_size);
        size = _size;
        index = 0;
    }

    // Функция для добавления нового значения в буфер
    function add(uint256 value) public {
        buffer[index] = value;
        // Обновляем индекс, используя модульный оператор для циклического перемещения по массиву
        index = (index + 1) % size;
    }

    // Функция для получения значения по индексу
    function get(uint256 idx) public view returns (uint256) {
        require(idx < size, "Index out of bounds");
        // Используем модульный оператор для корректного доступа к значениям в циклическом массиве
        return buffer[(index + idx) % size];
    }

    // Функция для получения текущего размера буфера
    function getSize() public view returns (uint256) {
        return size;
    }
}

